    <Router>
      <div>
        <Link to="/">Home</Link>
        <Link to="/About">About</Link>
      </div>

      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>

        <Route path="/About" exact>
          <About />
        </Route>
      </Switch>

    </Router>
  );
};

export default App;
